async function fetchCompletionRateData(page) {
    try {
      const apiToken = 'd0NLCpTnvtsY1gQu7S38RyF47fOjnHknynBjGzWxCwpXOJqXaNwWDrGqFomq';

      const response = await axios.get(
        `https://3c.fluxoti.com/api/v1/campaigns?paused=false&page=${page}&api_token=${apiToken}`
      );

      const data = response.data.data;

      console.log(`API Response Data for Completion Rate - Page ${page}:`, data);

      if (!Array.isArray(data)) {
        console.error(`Invalid data format received on Page ${page}. Expected an array.`);
        setError('Error fetching completion rate data. Please try again later.');
        setLoading(false);
        return;
      }

      const newCompletionRateData = data.map((campaign) => ({
        name: campaign.name,
        completion_rate: campaign.exit_manual_mode === 30 ? 1 : 0,
      }));

      console.log('Formatted Completion Rate Data:', newCompletionRateData);

      if (newCompletionRateData.length === 0) {
        console.error(`No valid data found on Page ${page}.`);
        setError('Error fetching completion rate data. Please try again later.');
        setLoading(false);
        return;
      }

      // Restante do código...
    } catch (error) {
      console.error(`Error fetching completion rate data - Page ${page}:`, error);
      setError('Error fetching completion rate data. Please try again later.');
      setLoading(false);
    }
  }
